import React, { useState } from 'react';

const AdminDashboard = ({ token }) => {
  // Chỉ là giao diện mẫu, chưa có chức năng thực tế
  return (
    <div className="min-h-screen bg-gray-50 p-8">
      <h1 className="text-3xl font-bold mb-6">Quản trị nội dung</h1>
      <div className="grid md:grid-cols-3 gap-8">
        <div className="bg-white p-6 rounded shadow">
          <h2 className="text-xl font-bold mb-2">Banner</h2>
          <button className="bg-blue-500 text-white px-4 py-2 rounded">Thay đổi banner</button>
        </div>
        <div className="bg-white p-6 rounded shadow">
          <h2 className="text-xl font-bold mb-2">Hình ảnh</h2>
          <button className="bg-blue-500 text-white px-4 py-2 rounded">Thêm/Xóa hình ảnh</button>
        </div>
        <div className="bg-white p-6 rounded shadow">
          <h2 className="text-xl font-bold mb-2">Tin tức</h2>
          <button className="bg-blue-500 text-white px-4 py-2 rounded">Thêm/Xóa/Sửa tin tức</button>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
